import React from 'react';
import './App.css';

function App() {
  const url="https://source.unsplash.com/collection/1971015/300x300/?sig=";
  const images = document.querySelectorAll("img");
  images.att.src = url;

  return (
    <div className="App">
      <header className="Header-Text">
        Good Morning!
      </header>
      <body className="Body-Picture">
        <img src="" alt="unsplash"/>
        Body picture goes here
      </body>
      <div className="Footer-Credits">
        Made with {"<3"} by  <a id="websiteLink" href="https://mesagoh.github.io"> Melissa Goh </a> , 2019
      </div>
    </div>
  );
}

export default App;
